import React from "react";

const Navbar = () => {
  return (
    <nav className="bg-green-700 text-white">
      <div className="max-w-7xl mx-auto px-4">
        <div className="flex justify-between items-center h-16">
          
          {/* Logo / Title */}
          <div className="text-xl font-bold">
            Digital Gram Panchayat
          </div>

          {/* Menu */}
          <ul className="hidden md:flex space-x-6 font-medium">
            <li className="hover:text-yellow-300 cursor-pointer">Home</li>
            <li className="hover:text-yellow-300 cursor-pointer">Services</li>
            <li className="hover:text-yellow-300 cursor-pointer">Schemes</li>
            <li className="hover:text-yellow-300 cursor-pointer">Contact</li>
          </ul>

          {/* Button */}
          <button className="hidden md:block bg-yellow-400 text-black px-4 py-1 rounded hover:bg-yellow-300">
            Login
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
